import { defineComponent, reactive } from "vue";
import { useRouter } from "vue-router";
import axios from "axios";
import store from "@/store"; // import the store instance

export default defineComponent({
  setup() {
    const formItemLayout = {// layout options
    };
    const config = {// form validation rules
    };
    const rangeConfig = {// form validation rules for range picker
    };
    const formState = reactive({});
    const router = useRouter();

    const onFinish = async values => {
      console.log("Success:", values, formState); // create a JSON object from the form data

      const formData = {
        destination: formState.destination,
        rangeTimePicker: formState.rangeTimePicker
      };

      try {
        // send a POST request to the server with the form data
        const response = await axios.post("http://localhost:8080/submit-form", formData);
        console.log(response.data); // response from the server
        // dispatch the setResponseData action to update the store state

        store.dispatch("setResponseData", response.data); // navigate to the /plan route and pass the response data as a query parameter

        router.push({
          name: "plan",
          query: {
            gptresponse: response.data
          }
        });
      } catch (error) {
        console.error(error);
      }
    };

    const onFinishFailed = errorInfo => {
      console.log("Failed:", errorInfo);
    };

    const plan = async () => {
      try {
        // Trigger the onFinish function to submit the form data
        await onFinish(); // navigate to the /plan page

        router.push("/plan");
      } catch (error) {
        console.error(error);
      }
    };

    return {
      formState,
      onFinish,
      onFinishFailed,
      formItemLayout,
      config,
      rangeConfig,
      plan
    };
  }

});
